import React, { useRef, useState } from 'react';
// Import Swiper React components
import { Swiper, SwiperSlide } from 'swiper/react';

// Import Swiper styles
import 'swiper/css';
import 'swiper/css/pagination';
import 'swiper/css/navigation';

import '../styles.css';

// import required modules
import { Autoplay, Pagination, Navigation } from 'swiper/modules';

export default function ImageSlider() {
  return (
    <>
      <Swiper
        spaceBetween={30}
        centeredSlides={true}
        autoplay={{
          delay: 2500,
          disableOnInteraction: false,
        }}
        pagination={{
          clickable: true,
        }}
        navigation={true}
        modules={[Autoplay]}
        className="mySwiper"
      >
        <SwiperSlide>
            <img src="/1.jpeg" alt="1" className='h-[300px]' />
        </SwiperSlide>
        <SwiperSlide>
            <img src="/2.jpeg" alt="2" className='h-[300px]'/>
        </SwiperSlide>
        <SwiperSlide>
            <img src="/3.jpeg" alt="3" className='h-[300px]' />
        </SwiperSlide>
       
      </Swiper>
    </>
  );
}
